import React from 'react';
import {Link} from 'react-router-dom';
import Product from './Product.js';
import People from './People.js';
import logo from './logo.jpg';

function Header(){
	return(
	<div>
		<h4 className="title "><img src={logo}/> Exerevnisi </h4>

	<ul className="nav-links">
		<li>
			<Link  to="/" style={{ color:'black',textDecoration: 'none' }}>Home</Link>
		</li>
		<li>
			<Link exact to="/product"  activeStyle={{ color: 'red' }} style={{color:'blue', textDecoration: 'none' }}>Product</Link>
		</li>
		<li>
			<Link exact to="/people"  activeStyle={{ color: 'red' }} style={{ color:'black',textDecoration: 'none' }}>People </Link>
		</li>
		<li>
			<Link to="/join us" style={{ color:'black',textDecoration: 'none' }}>Join Us</Link>
		</li>
	</ul>

	<hr/>	
	</div>

	);
}

export default Header;
